namespace Mod003263.wpf {

    /// <summary>
    /// Generates image data from base64 string
    /// </summary>
    public class Base64Converter {

        public const String TEST_IMAGE =
            "";
        public const String ERROR_IMAGE =
            "";

        private static BitmapImage errorImage;

        public static BitmapImage ErrorImage() {
            return errorImage ?? (errorImage = new Base64Converter().ConvertToBitmapImage(ERROR_IMAGE));
        }

        private static Base64Converter instance;

        public static Base64Converter GetInstance() {
            return instance ?? (instance = new Base64Converter());
        }

        /// <summary>
        /// Helper method to reduce source-code footprint and to handle casting
        /// </summary>
        /// <param name="base64">The base64-encoded image</param>
        /// <returns>Bitmap image of the provided base64</returns>
        public BitmapImage ConvertToBitmapImage(String base64) {
            return ConvertToBitmapImage(base64, null, null, null) as BitmapImage;
        }
        public String ConvertToBase64(BitmapImage img) {
            return ConvertToBase64(img, null, null, null) as String;
        }

        /// <summary>
        /// Converts a base64 string to a <see cref="BitmapImage" />
        /// </summary>
        /// <param name="value">The base64-encoded image</param>
        /// <param name="targetType">[Not used]</param>
        /// <param name="parameter">[Not used]</param>
        /// <param name="culture">[Not used]</param>
        /// <returns>Bitmap image of the provided base64</returns>
        public object ConvertToBitmapImage(object value, Type targetType, object parameter, CultureInfo culture) {
            if (value == null || value.ToString().Length <= 8) return ErrorImage();
            String s = value.ToString();
            BitmapImage img = new BitmapImage();
            try{
                img.BeginInit();
                img.StreamSource = new MemoryStream(System.Convert.FromBase64String(s));
                img.EndInit();
            }catch{
                return ErrorImage();
            }

            return img;
        }

        public object ConvertToBase64(object value, Type targetType, object parameter, CultureInfo culture) {
            BitmapImage img = value as BitmapImage;
            if (img == null) return "";
            Bitmap bitmap = BitmapImageToBitmap(img);
            MemoryStream stream = new MemoryStream();
            bitmap.Save(stream, System.Drawing.Imaging.ImageFormat.Bmp);
            byte[] imageBytes = stream.ToArray();
            return Convert.ToBase64String(imageBytes);
        }

        // http://stackoverflow.com/questions/6484357/converting-bitmapimage-to-bitmap-and-vice-versa
        private Bitmap BitmapImageToBitmap(BitmapImage bitmapImage) {
            using(MemoryStream outStream = new MemoryStream()) {
                BitmapEncoder enc = new BmpBitmapEncoder();
                enc.Frames.Add(BitmapFrame.Create(bitmapImage));
                enc.Save(outStream);
                Bitmap bitmap = new Bitmap(outStream);
                return new Bitmap(bitmap);
            }
        }



    }
}
